uk-UA:
Ваш маршрут зазнає таких змін:
— Призначені модифікатори будуть замінені на поточний активний модифікатор у вашому регіоні;
— Вороги з попередніх сезонів (наприклад, Tormented Lieutenants) будуть видалені з усіх сутичок, у яких вони перебували;
— Якщо наявна сутичка містить групу ворогів із зашифрованими реліквіями, вони будуть додані до тієї сутички.
Упевнені, що хочете продовжити перенесення?

Ваш маршрут зазнає таких змін:
— Призначені модифікатори будуть замінені на поточний активний модифікатор у вашому регіоні;
— Вороги з попередніх сезонів (наприклад, вороги з ефектом Encrypted) будуть видалені з усіх сутичок, у яких вони перебували;
— Вороги з ефектом Shrouded будуть додані до маршруту, якщо вони перебували в наявних сутичках.
Упевнені, що хочете продовжити перенесення?
